function Schedule() {
    return (
        <div className="schedule">
            <div className="create_div">
                <form className="border">
                    <button type="button">
                        <img src="/images/add.png" alt="Add" style={{ width: '50px', height: '50px' }} />
                    </button>
                </form>
            </div>
            <div className="list_div border">
            </div>
        </div>
    );
}

export default Schedule;
